Text:
@JoSox: Treme's destiny was interlaced with quark's. So, Treme accompanied our smallest, on his way... out... or someplace else...
Tudors could go.
Justified, if I was asked day before yesterday, answer would be - no. I promised Justified only as "jump-in" and I did it - four times. Little too much. Well, as you helped yesterday, I'll change my mind and say - yes, I promise.
